import React, {Component} from 'react'

class Home extends Component {
  constructor(props) {
    super(props)
  } 
  render(props){
    let b = this.props.element
    return(
      <div>
        <p>Home</p>
        <ul>
            {
              b.map((blog)=>(
                <li>{blog}</li>
              )
              )
            }
        </ul>
      </div>

    )
  }
}

export default Home
